import React from "react"
import { HStack, Stack, Center, Heading, NativeBaseProvider, Image } from "native-base"


var urlList = ["https://wallpaperaccess.com/full/317501.jpg"]
export function Example() {
  return (
    <Stack space={3} alignItems="center">
      <HStack space={3} alignItems="center">
        <Image
            size={150}
            resizeMode={"contain"}
            borderRadius={100}
            source={{
                uri: "https://wallpaperaccess.com/full/317501.jpg",
            }}
            alt="Alternate Text"
        />

        <Image
            size={150}
            resizeMode={"contain"}
            borderRadius={100}
            source={{
                uri: "https://wallpaperaccess.com/full/317501.jpg",
            }}
            alt="Alternate Text"
        />

        <Image
            size={150}
            resizeMode={"contain"}
            borderRadius={100}
            source={{
                uri: "https://wallpaperaccess.com/full/317501.jpg",
            }}
            alt="Alternate Text"
        />
      </HStack>
    </Stack>
  )
}

export const HorizontalStack = () => {
  return (
    <NativeBaseProvider>
      <Center flex={1} px="3">
        <Example />
      </Center>
    </NativeBaseProvider>
  )
}
